import React from 'react'
function Options(props){
    return(
        <div>
            <img onClick = {props.clicked(1)}/>
            <img onClick = {props.clicked(2)}/>
            <img onClick = {props.clicked(3)}/>
            <img onClick = {props.clicked(4)}/>
        </div>
    )
}
export default Options
